import React from "react";
import Layout from "../../../Common/Component/Layout";
import event5img from "../../../Image/event5_img.png";
import "./index.scss";

export default function View(props) {
  const { handleSignup } = props;
  return (
    <Layout>
      <div className="Page--Event5Detail">
        <div className="Event5_Inner">
          <img src={event5img} alt="test" />
          <div className="Event5_Signin" onClick={handleSignup} />
        </div>
      </div>
    </Layout>
  );
}
